import { Directive, Injector, Input } from '@angular/core';
import { AbstractControl, NgControl } from '@angular/forms';
import { EvoControlState } from '../interfaces/evo-control-state';
import { EvoControlError } from '../interfaces/evo-control-error';

@Directive()
export class EvoBaseControl {

    @Input() errorsMessages: EvoControlError | undefined;
    @Input() state: EvoControlState | undefined;

    private _control: AbstractControl | undefined;

    constructor(
        protected injector: Injector,
    ) {
    }

    get control(): AbstractControl | undefined {
        if (!this._control) {
            this.initBaseControl();
        }
        return this._control;
    }

    set control(control: AbstractControl | undefined) {
        this._control = control;
    }

    initBaseControl() {
        const ngControl = this.injector?.get(NgControl, null);
        if (ngControl?.control) {
            this._control = ngControl?.control;
        }
    }

    get currentState(): EvoControlState {
        return Object.assign(
            {
                valid: this.control ? this.control.dirty && this.control.touched && this.control.valid : undefined,
                invalid: this.control ? this.control.dirty && this.control.touched && this.control.invalid : undefined,
            },
            this.state,
        );
    }

    get showErrors(): boolean {
        return this.currentState.invalid;
    }

}

import {Directive, ElementRef, EventEmitter, HostListener, Output} from '@angular/core';

@Directive({
    selector: '[evoClickOutside]',
})
export class EvoClickOutsideDirective {

    @Output() readonly evoClickOutside = new EventEmitter();

    constructor(
        private readonly elementRef: ElementRef,
    ) {
    }

    @HostListener('document:click', ['$event', '$event.target'])
    onClick<T extends MouseEvent, F extends HTMLElement>(event: T, targetElement: F) {
        this.clickOrTouchOutside(event, targetElement);
    }

    @HostListener('document:touchstart', ['$event', '$event.target'])
    onTouchStart<T extends MouseEvent, F extends HTMLElement>(event: T, targetElement: F) {
        this.clickOrTouchOutside(event, targetElement);
    }

    clickOrTouchOutside<T extends MouseEvent, F extends HTMLElement>(event: T, targetElement: F) {
        if (!targetElement) {
            return;
        }
        const clickedInside = this.elementRef.nativeElement.contains(targetElement);
        if (!clickedInside) {
            this.evoClickOutside.emit(event);
        }
    }
}

import {
    Directive,
    EventEmitter,
    Input,
    OnChanges,
    OnDestroy,
    OnInit,
    Optional,
    Output,
    SimpleChanges,
    TemplateRef,
    ViewContainerRef
} from '@angular/core';
import {Subject} from 'rxjs';
import {takeUntil} from 'rxjs/operators';
import {EvoExpandedService} from '../../services';

@Directive({
    selector: '[evoIsExpanded]'
})
export class EvoIsExpandedDirective implements OnInit, OnChanges, OnDestroy {

    @Input() evoIsExpanded: boolean | undefined;
    @Output() evoIsExpandedChange = new EventEmitter<boolean>(false);

    private readonly destroy$ = new Subject<void>();

    constructor(
        private readonly templateRef: TemplateRef<any>,
        private readonly viewContainer: ViewContainerRef,
        @Optional() private expandedService: EvoExpandedService,
    ) {
    }

    ngOnInit(): void {
        if (this.expandedService) {
            this.expandedService.isExpanded = !!this.evoIsExpanded;
        }
        this.updateView();
        this.handleExpandedChange();
    }

    ngOnChanges(changes: SimpleChanges): void {
        if (changes['evoIsExpanded'] && !changes['evoIsExpanded'].isFirstChange()) {
            const isExpanded = changes['evoIsExpanded'].currentValue;
            if (!this.expandedService) {
                this.evoIsExpandedChange.emit(isExpanded);
                this.updateView();
                return;
            }
            this.expandedService.isExpanded = isExpanded;
        }
    }

    ngOnDestroy(): void {
        this.destroy$.next();
        this.destroy$.unsubscribe();
    }

    handleExpandedChange(): void {
        this.expandedService?.isExpandedChange$.pipe(
            takeUntil(this.destroy$)
        ).subscribe(isExpanded => {
            if (isExpanded !== this.evoIsExpanded) {
                this.evoIsExpanded = isExpanded;
                this.evoIsExpandedChange.emit(isExpanded);
            }
            this.updateView();
        });
    }

    private updateView(): void {
        if (this.evoIsExpanded && this.viewContainer.length !== 0) {
            return;
        }
        if (this.evoIsExpanded) {
            this.viewContainer.createEmbeddedView(this.templateRef);
        } else {
            this.viewContainer.clear();
        }
    }
}

import {
    Directive,
    DoCheck,
    ElementRef,
    Input,
    IterableChanges,
    IterableDiffer,
    IterableDiffers,
    KeyValueChanges,
    KeyValueDiffer,
    KeyValueDiffers,
    Renderer2,
    ɵisListLikeIterable as isListLikeIterable,
    ɵstringify as stringify,
} from '@angular/core';


/* eslint-disable */

/**
 * @usageNotes
 * ```
 *     <some-element [evoUiClass]="'first second'">...</some-element>
 *
 *     <some-element [evoUiClass]="['first', 'second']">...</some-element>
 *
 *     <some-element [evoUiClass]="{'first': true, 'second': true, 'third': false}">...</some-element>
 *
 *     <some-element [evoUiClass]="stringExp|arrayExp|objExp">...</some-element>
 *
 *     <some-element [evoUiClass]="{'class1 class2 class3' : true}">...</some-element>
 * ```
 *
 * @description
 *
 * Adds and removes CSS classes on an HTML element.
 *
 * The CSS classes are updated as follows, depending on the type of the expression evaluation:
 * - `string` - the CSS classes listed in the string (space delimited) are added,
 * - `Array` - the CSS classes declared as Array elements are added,
 * - `Object` - keys are CSS classes that get added when the expression given in the value
 *              evaluates to a truthy value, otherwise they are removed.
 */
@Directive({
    selector: '[evoUiClass]',
})
export class EvoUiClassDirective implements DoCheck {
    private iterableDiffer !: IterableDiffer<string> | null;
    private keyValueDiffer !: KeyValueDiffer<string, any> | null;
    private initialClasses: string[] = [];
    private rawClass !: string[] | Set<string> | {[klass: string]: any};

    constructor(
        private _iterableDiffers: IterableDiffers,
        private _keyValueDiffers: KeyValueDiffers,
        private _ngEl: ElementRef,
        private _renderer: Renderer2,
    ) {
    }


    @Input('class')
    set klass(value: string) {
        this.removeClasses(this.initialClasses);
        this.initialClasses = typeof value === 'string' ? value.split(/\s+/) : [];
        this.applyClasses(this.initialClasses);
        this.applyClasses(this.rawClass);
    }

    @Input()
    set evoUiClass(value: string | string[] | Set<string> | {[klass: string]: any}) {
        this.removeClasses(this.rawClass);
        this.applyClasses(this.initialClasses);

        this.iterableDiffer = null;
        this.keyValueDiffer = null;

        this.rawClass = typeof value === 'string' ? value.split(/\s+/) : value;

        if (this.rawClass) {
            if (isListLikeIterable(this.rawClass)) {
                this.iterableDiffer = this._iterableDiffers.find(this.rawClass).create();
            } else {
                this.keyValueDiffer = this._keyValueDiffers.find(this.rawClass).create();
            }
        }
    }

    ngDoCheck(): void {
        if (this.iterableDiffer) {
            const iterableChanges = this.iterableDiffer.diff(this.rawClass as string[]);
            if (iterableChanges) {
                this.applyIterableChanges(iterableChanges);
            }
        } else if (this.keyValueDiffer) {
            const keyValueChanges = this.keyValueDiffer.diff(this.rawClass as {[k: string]: any});
            if (keyValueChanges) {
                this.applyKeyValueChanges(keyValueChanges);
            }
        }
    }

    private applyKeyValueChanges(changes: KeyValueChanges<string, any>): void {
        changes.forEachAddedItem((record) => this.toggleClass(record.key, record.currentValue));
        changes.forEachChangedItem((record) => this.toggleClass(record.key, record.currentValue));
        changes.forEachRemovedItem((record) => {
            if (record.previousValue) {
                this.toggleClass(record.key, false);
            }
        });
    }

    private applyIterableChanges(changes: IterableChanges<string>): void {
        changes.forEachAddedItem((record) => {
            if (typeof record.item === 'string') {
                this.toggleClass(record.item, true);
            } else {
                throw new Error(
                    `EvoUiClass can only toggle CSS classes expressed as strings, got ${stringify(record.item)}`);
            }
        });

        changes.forEachRemovedItem((record) => this.toggleClass(record.item, false));
    }

    /**
     * Applies a collection of CSS classes to the DOM element.
     *
     * For argument of type Set and Array CSS class names contained in those collections are always
     * added.
     * For argument of type Map CSS class name in the map's key is toggled based on the value (added
     * for truthy and removed for falsy).
     */
    private applyClasses(rawClassVal: string[] | Set<string> | {[klass: string]: any}) {
        if (rawClassVal) {
            if (Array.isArray(rawClassVal) || rawClassVal instanceof Set) {
                (rawClassVal as any).forEach((klass: string) => this.toggleClass(klass, true));
            } else {
                Object.keys(rawClassVal).forEach(klass => this.toggleClass(klass, !!rawClassVal[klass]));
            }
        }
    }

    /**
     * Removes a collection of CSS classes from the DOM element. This is mostly useful for cleanup
     * purposes.
     */
    private removeClasses(rawClassVal: string[] | Set<string> | {[klass: string]: any}) {
        if (rawClassVal) {
            if (Array.isArray(rawClassVal) || rawClassVal instanceof Set) {
                (rawClassVal as any).forEach((klass: string) => this.toggleClass(klass, false));
            } else {
                Object.keys(rawClassVal).forEach(klass => this.toggleClass(klass, false));
            }
        }
    }

    private toggleClass(klass: string, enabled: boolean): void {
        const prefix = this.initialClasses[0];

        const prefixClasses = (classes: string) => {
            return classes.trim()
                .split(' ')
                .filter(k => k.trim())
                .map(k => prefix + '_' + k)
                .join(' ');
        };

        klass = this.initialClasses.indexOf(klass) === -1
            ? prefixClasses(klass)
            : klass.trim();

        if (klass) {
            klass.split(/\s+/g).forEach(_klass => {
                if (enabled) {
                    this._renderer.addClass(this._ngEl.nativeElement, _klass);
                } else {
                    this._renderer.removeClass(this._ngEl.nativeElement, _klass);
                }
            });
        }
    }
}

